import React, { useEffect } from 'react';
import { connect } from 'react-redux'
import PropTypes from 'prop-types';
import {logInWithToken} from '../actions/tokenManagement';
const AsyncApp = (props) =>{
    const {proxy,dispatch} = props;
    useEffect(()=>{
        function logIn() {
            dispatch(logInWithToken(proxy + '/sign_up','sdfsdfsdf'));
        }
        logIn();
    },[]);
    return (
        <div>
            sdfsdf sdfsdf sdf s
        </div>
    )
}
function mapStateToProps(state) {
    const { proxy } = state
    return {
      proxy
    }
}
AsyncApp.propTypes = {
    proxy: PropTypes.string.isRequired,
  }
export default connect(mapStateToProps)(AsyncApp);
